	public void writeMethod(File file, String content) throws IOException {
		FileWriter writer = new FileWriter(file);
		writer.write(content);
		writer.close();
	}
	
	public void bufferedWriterMethod(File file, String content) throws IOException{
		BufferedWriter bw = new BufferedWriter(new FileWriter(file));
		bw.write(content);
		bw.flush();
		bw.close();
	}
	
	public void outputStreamWriterMethod(File file, String content) throws IOException {
		OutputStream os = new FileOutputStream(file);
		os.write(content.getBytes());
		os.flush();
		os.close();
	}

